import React from 'react';
import Iframe from "react-iframe";
import DualPane from "../utlilty/DualPane";
import Grid from "@material-ui/core/Grid";
import InfoCard from "../utlilty/InfoCard";
import Button from "@material-ui/core/Button";
import PersonIcon from '@material-ui/icons/Person';
import makeStyles from "@material-ui/core/styles/makeStyles";
import lime from "@material-ui/core/colors/lime";
import trek from '../images/Hobbies/Trek_Lake.jpg';

const useStyles = makeStyles(theme => ({
    link: {
        position: 'absolute',
    },
    img: {
        float: "left",
        width: "50%",
        height: "50%",
        marginLeft: 25,
        marginRight: 25
    }
}));

export default function Running() {
    const classes = useStyles();
    return (
        <div>
            <img className={classes.img} src={trek} alt="Badminton" />
            <Grid style={{padding: 20}} container justify="space-evenly" spacing={3}>
                <Grid item xs={7}>
                    <InfoCard>
                        <ul>
                            <li> Started serious training badminton at the age of 11. Trained in Bangalore and Chennai. </li>
                            <li> Participated competitively in local, and state tournaments.
                                Won school tournaments and runner-up in the Cosmopolitan Club Tournament at the age of 12. </li>
                            <li> </li>
                        </ul>

                    </InfoCard>
                </Grid>
                <Grid item xs={5}>
                    <InfoCard anec>
                        I watched my friend, <i>Angelo Zhang</i>, from the Cubing Club at UT Austin
                        set the world record for 3x3 Blindfolded with a 22.36 sec average!
                        <br/> I also judged a competitor solve 19 cubes blindfolded in 3x3 multiblind at nationals!
                    </InfoCard>
                </Grid>
            </Grid>
        </div>
    );
}
